    <>
        <Header/>
        <main>
            <h1 className="titulo-form"> 
             Bem-vindo ao Nicho </h1>

           <form>
               <input type='text' name="username" placeholder="username" />
               <input type='password' name="senha" placeholder="senha" />
               <button>enviar</button>
           </form>


        </main>
    </>
    )
}
export default Login;
